snippet.textDisplay:
@WonByStep Si, mi madre es enfermera en el INER; ha estado desde el inicio hasta ahora al pie del cañón, ya muerieron varios compañeros, y la cantidad que se observa de decesos no tiene nada que ver con lo que dicen los medios.
Vente a la clínica Ajusco Medio cuando quieras, ya van más de 30 mil muertos ahí.
Multiplica eso por cada centro de salud y clínicas y te darás una idea.

