snippet.textDisplay:
@intelectube 23 De qué deduces eso? Crees que si hay un virus estar en casa hace que no te contagies? Y el contacto con tu familia? Precisamente en invierno una de las razones de que haya más enfermedades no es tanto el frío como que estamos más tiempo en interiores.

España con el confinamiento más duro tiene mayor proporción de supuestos muertos y contagios, países sin confinamiento tan tranquilos.

Emosido engañado.

